import React from 'react';
import { StyleSheet, Text, View } from 'react-native';

export default function TodoList(props){
 return(
  <View style={styles.container}>
      <View style={styles.header}>
          <Text>TODO LIST</Text>
      </View>
  </View>
 );
}

const styles = StyleSheet.create({
    container : {
        margin: 10,
        backgroundColor: '#FFF'
    },
    header : {
        flex: 1,
        alignContent: 'center'
    }
})
